from typing import List


class Solution:
    def busiestServers(self, k: int, arrivals: List[int], loads: List[int]) -> List[int]:
        if k >= len(loads):
            return [i for i in range(len(loads))]

        servers = [0] * k
        job_handled = [0] * k

        def findEmpty(i: int, arrival: int) -> int:
            for j in range(k):
                select = (i + j) % k
                if servers[select] <= arrival:
                    return select

            return -1

        for i, (arrival, load) in enumerate(zip(arrivals, loads)):
            num = findEmpty(i, arrival)
            if num < 0:
                # dropped
                continue

            servers[num] = arrival + load
            job_handled[num] += 1

        return [i for i, count in enumerate(job_handled) if count == max(job_handled)]


